column8:
霊芝は別命マンネンタケとも呼ばれサルノコシカケ科に属するキノコです。本商品は本場中国でナラやクヌギ使用の原木栽培で丹念に育てられまし。石づきを取り徐いて有効成分が多い葉の部分だけの貴重な商品です。
<BR><BR><div align='center'><IMG src=https://image.rakuten.co.jp/dietshop/cabinet/4/reisihi-higumaya-01.gif><BR></div><BR>
完売の場合は取り寄せまで1週間程度のお時間を頂戴いたします。<BR>［名　　称］原型 霊芝<br>［原材料名］霊芝<br>［内容量］500ｇ<br>［召し上がり方］１日当り、ご自分に合った量（目安として１日５ｇ程度）を３～１５ｍｍ位に刻み水洗いし、水０．７リットルで煮出して下さい。カスは取り除き、お茶がわりに飲んで下さい。<br>［販売元］ひぐまや<br>［使用上の注意］抽出液は冷蔵庫で保管し、２～３日で飲みきって下さい。<br>［保存上の注意］高温多湿、直射日光を避けて保存して下さい。<br>

<br>■納期：3日-7日<br>※表記上の納期は、通常お届けとなります。<br>人気商品など変動の多い商品もございますので、<br>表記は目安としてご参考くださいますようお願い申し上げます。<br>その他/直送区分他： <br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

