■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>必須アミノ酸、各種ビタミン、ミネラルをバランスよく含有！</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0302/0100al-01.jpg" width="600" height="1070"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">1日3粒を目安にお召し上がりください。<br><br>製造販売者：株式会社エーエフシー<br>静岡県静岡市駿河区豊田2丁目4番3号</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="226" height="174" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0302/0100al-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">栄養価の高い産卵後21日目の貴重なオスの蜂の子を使用しています。健康に必要な必須アミノ酸、各種ビタミン、ミネラルをバランスよく含んでおり、生命力の強い植物「明日葉」にビンカマイナーを配合した自信の商品です。 </font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">栄養成分</font></td><td width="75%"><font color="#333333" size="-1">【1粒当たり】 エネルギー:1.73kcal、たんぱく質:0.11g、脂質:0.08g、炭水化物:0.16g、ナトリウム:0～2mg</font></td></tr><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">蜂の子末、明日葉末、ビンカマイナーエキス末、デキストリン、HPMC、ステアリン酸Ca、加工デンプン、微粒二酸化ケイ素</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">栄養価の高い産卵後21日目の貴重なオスの蜂の子を使用しています。健康に必要な必須アミノ酸、各種ビタミン、ミネラルをバランスよく含んでおり、生命力の強い植物「明日葉」にビンカマイナーを配合した自信の商品です。 </font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">310mg×90粒</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：9×5×5cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">62g</font><br><font color="#333333" size="-1">個装重量：62g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">保存方法：高温多湿および直射日光を避け、涼しい所に保存してください。</font><br><font color="#333333" size="-1">賞味期間：製造日より2年</font><br><font color="#333333" size="-1">アルミ袋入り</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
