■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>海のフルーツ、めしあがれ。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5203/4653bp-01.jpg" width="600" height="450"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【お召し上がり方】<br>1箱を約1ヶ月程度の目安としてお召し上がり下さい。1包には2粒入っていますから、旅行に行かれる時などは、旅行日数分の分包をお持ちになって、お召し上がりください。<br><br>【保存方法】<br>冷暗所で保存してください。<br><br>【販売者】<br>フジワラ化学株式会社 FS(食品事業部)<br>〒799-1342　愛知県西条市大新田94</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">「海のミルク」と呼ばれるカキは、ビタミン、ミネラル、タウリンや微量栄養素を豊富に含んだ栄養価の高い自然食品です。「オイスターFゴールド」に使用しているカキ肉エキスには、現在注目の核酸関連物質や亜鉛、タウリン、アミノ酸などがバランス良く含まれています。また、このカキ肉エキスを主原料に酵母エキス、シジミエキス、グァバ葉エキスを配合しています。</font></td></tr></table><br><!--栄養成分・原材料表ここから--><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" bgcolor="#FFFFCC"><font color="#333333" size="-1">原材料</font></td><td width="75%"><font color="#333333" size="-1">カキエキス、ショ糖、乳糖、酵母エキス、デキストリン、シジミエキス、グァバ葉エキス、セルロース、炭酸Ca、アラビアガム、カラメル色素、乳化剤、V.B6、ゼラチン、V.B1、セラック、V.B2、カカオ色素、カルナウバロウ</font></td></tr></table><br><!--栄養成分・原材料表ここまで--><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">「海のミルク」と呼ばれるカキは、ビタミン、ミネラル、タウリンや微量栄養素を豊富に含んだ栄養価の高い自然食品です。「オイスターFゴールド」に使用しているカキ肉エキスには、現在注目の核酸関連物質や亜鉛、タウリン、アミノ酸などがバランス良く含まれています。また、このカキ肉エキスを主原料に酵母エキス、シジミエキス、グァバ葉エキスを配合しています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：10×5×6cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：60g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：食品</font><br><font color="#333333" size="-1">名称：カキ加工食品</font><br><font color="#333333" size="-1">賞味期間：製造日より720日</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
